import { Component } from 'react';

class TOC extends Component {
    render(){
      var lists = [];
      var hello = this.props.data;
      var i = 0;
      while(i<hello.length){
        lists.push(<li key={hello[i].id}><a href={"/content/"+hello[i].id}>{hello[i].title}</a></li>);
        i++;
      }
      return(
        <nav>
            <ul>
              {lists}
            </ul>
        </nav> 
      );
    }
  }

  export default TOC;
